DROP TABLE IF EXISTS `wr_map_setting`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `wr_map_setting` (
  `idx` int(4) unsigned NOT NULL AUTO_INCREMENT COMMENT '키',
  `skin` varchar(10) DEFAULT NULL COMMENT '스킨 : dark ,lite',
  `setval` varchar(200) NOT NULL COMMENT 'radar:레이더,heroes 위성, tutor 지도, temp 온도, wind 풍향, rain 강우, snow 적설 cannon 태풍 ,flow 수위 ',
  `x_organ` varchar(100) DEFAULT NULL COMMENT '시군청 X 좌표',
  `y_organ` varchar(100) DEFAULT NULL COMMENT '시군청 Y 좌표',
  `top_img` varchar(255) DEFAULT NULL COMMENT '상단바 로고 경로',
  `top_text` varchar(100) DEFAULT NULL COMMENT '상단바 텍스트',
  `map_skin` int(2) DEFAULT '1' COMMENT '1: 일반, 2: 위성',
  `map_type` int(2) DEFAULT '1' COMMENT '1: 지도, 2: 지도 및 우측 공간',
  `map_sub` int(2) DEFAULT '1' COMMENT '1: 레이더/위성, 2: 레이더/태풍, 3: 위성/태풍, 4: 테이블',
  `x_cent` varchar(100) DEFAULT NULL COMMENT '지도 중심 X 좌표',
  `y_cent` varchar(100) DEFAULT NULL COMMENT '지도 중심 Y 좌표',
  `map_level` varchar(100) DEFAULT '8' COMMENT '지도 확대 레벨',
  `map_move` int(2) DEFAULT '1' COMMENT '1: 장비 이동 불가, 2: 장비 이동 가능',
  `map_size` int(2) DEFAULT '2' COMMENT '0: 아이콘, 1: 소, 2: 중, 3: 대',
  `map_box` int(2) DEFAULT '2' COMMENT '1: 읍면동, 2: 장비',
  `map_kind` int(2) DEFAULT '1' COMMENT '1: 상황판, 2: 장비상태, 3: 태풍, 4: 예보',
  `map_data` varchar(100) DEFAULT '1' COMMENT '1: 강우, 2: 수위, 3: 적설, 4: aws, 5: 방송, 6: cctv, 7: 문자전광판, 8: 스틸컷, 9 현장중계',
  `over_level` int(2) DEFAULT '9' COMMENT '오버레이가 사라지는 확대 레벨',
  `clus_level` int(2) DEFAULT '11' COMMENT '클러스터가 생기는 확대 레벨',
  `udate` varchar(100) DEFAULT NULL COMMENT '수정날짜',
  `indate` varchar(100) DEFAULT NULL COMMENT '입력날짜',
  `SIG_CD` varchar(12) NOT NULL COMMENT '지역코드',
  `api_key` varchar(100) NOT NULL,
  PRIMARY KEY (`idx`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='기상상황판 설정';
